import React from "react";

type HomeProps = {
    userName: string;
};
const Home: React.FC<HomeProps> = ({ children, userName }) => (
    <React.Fragment>
        <Header />
        <SplashSegment />
        <HowToSegment />
        <TestimonialSegment />
        <OurStorySegment />
        <React.Fragment>
            <BeAnickiSegment />
            <PartnerSegment />
            <CommunityReachSegment />
        </React.Fragment>
        <CompanyInfoSegment />

        <p>Hello, {userName}</p>

        {children}
    </React.Fragment>
);

export default Home;
